import s from './StylePizzaOrder/PizzaOrder.module.css'
import React from "react";
import {NavLink} from "react-router-dom";


class NewSnekOrder extends React.Component {
    state = {
        cost: this.props.snek[this.props.number].cost,
        photoURL: this.props.snek[this.props.number].photoURL,
        name: this.props.snek[this.props.number].name,
        structure: this.props.snek[this.props.number].structure,


    }


    componentDidUpdate(prevProps, prevState) {
        if (prevProps != this.props) {
            this.setState({
                photoURL: this.props.snek[this.props.number].photoURL,
                name: this.props.snek[this.props.number].name,
                structure: this.props.snek[this.props.number].structure,
                cost: this.props.snek[this.props.number].cost,

            })
        }
    }


    render() {

        return (
            <div className={s.content}>
                <div className={s.container}>
                    <div className={s.photo_pizza}>
                        <img src={this.state.photoURL} alt="" height="450" width="450"/>
                    </div>
                    <div className={s.pizza_info}>
                        <div className={s.menu}>
                            <NavLink className={s.link_menu} to="/profile/pizza"> Меню/</NavLink><NavLink
                            className={s.link_pizza}
                            to="/profile/pizza"> Пица/</NavLink>
                            <span className={s.link_name_pizza}>{this.state.name}</span>
                        </div>
                        <div className={s.pizza}>
                            <div className={s.name_pizza}>{this.state.name}</div>
                            <div className={s.cost_pizza}> Від {this.state.cost} грн</div>
                            <div className={s.strukture_pizza}>{this.state.structure}</div>
                        </div>
                    </div>
                </div>

            </div>
        )
    }
}


export default NewSnekOrder
